import React,{Component} from 'react';
import Railway from './Railway.PNG';

class CustomerDetails extends Component
{
    render() {
        return(
            <div style={rightStyle}>
             <div><img src={Railway} width="200px" height="330px" alt="Railway"/></div>
                <div style={downStyle}><button style={btnStyle}>View Bill</button></div>
            </div>
        );
    }
}

const rightStyle={
    position:'fixed',
    right:'1200px',
    left:'1200px',
    background:'LightGrey',
    width:'200px',
    height:'500px',
    textAlign:'left',
    border: '3px solid Black',
    borderTopStyle:'none'
};
const btnStyle={
    background:'red',
    color:'white',
    padding:'5px 8px',
    cursor:'pointer',
    float:'right',
    width:"110px",
    height:"50px"
};

const downStyle={
    margin: 'auto',
    width:"80px",
    padding:'10px',
    position: 'absolute',
    left:'170px',
    right:'180px',
    top: '350px',

};
export default CustomerDetails;
